import React , { useEffect, useState } from "react";
import './Feed.css'
import TweetBox from "./TweetBox/TweetBox";

const Feed=()=>{
    return(

     <div className="feed">
        <div className="feed__header">
        <h2>Home</h2>
             
        </div>
        <TweetBox/>
     </div>
    );
};

export default Feed;
